post_text:
JCPS school reentry information is now available at www.jcpsnc.org/reentry. The page will be updated periodically with the latest info and answers to frequently asked questions.
Planning for the new school year is still underway, so the reentry web page is the best place for current and accurate information regarding the opening of schools.
@jcpsnc #jcpsnc #jcpsreentry

