post_text:
Jackson County Public Schools, NC district and school administrators met with Dr. Elliott and Mr. Buchanan Monday for a briefing on the latest guidelines from the NC Department of Public Instruction regarding the extended school closing. Administrators were given three priorities:
1. Feeding and care of our students and staff;
2. Childcare issues;
3. Instruction.
We expect to address all three priorities with daily updates this week. You can see a log of all official updates at www.jcpsnc.org/covid19. There is a tremendous amount of work happening behind the scenes. Difficult times like these bring out the best in our community!
#jcpsnc

